import './App.css';
import { Inicio } from './home/inicio';
import { BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import { Ufm } from './ufm/Ufm';

function App() {
  return (
  <>
  <Router>
    <Routes>
      <Route path='/' element={<Inicio></Inicio>}/>
      <Route path='/ufm' element={<Ufm/>}/>
    </Routes>
  </Router>

  </>
  );
}

export default App;
